import React from 'react'
import "./styles.scss"
import MenuIcon from '@mui/icons-material/Menu';
import Person from '@mui/icons-material/Person';
import Mail from '@mui/icons-material/Mail';
import CloseIcon from '@mui/icons-material/Close';

export default function Topbar({ openNav, setOpenNav }) {
    // console.log("Set Open Nav", setOpenNav(!openNav))
    return (
        <div className={'topBar ' + (openNav && 'active')}>
            <div className="wrapper">
                <a href="#intro">
                    <h1 className={'logo ' + (openNav && "active")}>
                        SB
                    </h1>
                </a>
                <div className={"left " + (openNav && "active")}>
                    <div className="contactInformation">
                        <Person />
                        <span>+1 (111) 222 3333</span>
                        <Mail />
                        <span>test@gmail.com</span>
                    </div>
                </div>
                <div className="right">
                    {openNav && <CloseIcon className={'menuIcon'} onClick={() => setOpenNav(!openNav)} />}
                    {!openNav && <MenuIcon className={'menuIcon ' + (openNav && 'active')} onClick={() => setOpenNav(!openNav)} />}

                </div>
            </div>
        </div>
    )
}
